INSERT INTO `tbl_faq` VALUES (1,'I want to return my purchase! What do I do?','If you are not 100% satisfied with your purchase from our site you can return your item(s) for a full refund within 365 days of purchase. (Returns must be unworn, in the state you received them, and in the original packaging.)\r\n\r\nDid you know that returning merchandise is easy and informative, not to mention, can be fun? Check out this returns video for a sneak peek into some of our custom conference rooms.\r\n\r\nMake sure the merchandise is in its original packaging, (e.g., shoebox), and place it in a shipping box.  Attach the label to the sealed box.  Be sure to cover any old labels with the new one, or just peel them off.  A black marker can also be used to cover any existing bar codes.\r\n\r\nYou may drop off your return at any authorized UPS shipping location, but please do not drop your return off at a drop box.  To find the nearest authorized shipping location, please visit www.ups.com.\r\n\r\nIt may take 4-5 business days for your return to reach the Hackazon Centers. Once it is received and inspected (usually within 72 hours of receipt) your refund will be processed and automatically applied to your credit card or original method of payment within 7 days. Please note that depending on your credit card company, it may take an additional 2-10 business days after your credit is applied for it to post to your account.',NULL),(2,'Do you accept international credit cards?','Currently Hackazon can accept international credit cards but we can only ship to an address within the United States and its territories. Please note that the credit card must be issued and contain a logo from either Visa, Mastercard, Discover, or American Express.',NULL),(3,'What can cause my order to be delayed?','1. If the billing information you provided does not match what your bank has on file (including address and telephone number), your order may be delayed.\r\n\r\n2. We all love sending gifts to others and ourselves as much as we love receiving them. However, if you are shipping to an address other than your billing address, your order may be delayed.',NULL),(4,'dasdasdasdasd','Processing...','azrael@asd.com'),(5,'\'or 1=\'1\'','Processing...','hola@hola.com'),(6,'Question.','Processing...','nelson.fleitas@fiuni.edu.py'),(7,'\'or 1=\'1\'','Processing...','pamela.tamay@fiuni.edu.py'),(8,'\'or 1=\'1\'','Processing...','ricardo.gonzalez@fiuni.edu.py'),(9,'aaa','Processing...','ricardo.gonzalez@fiuni.edu.py'),(10,'\' UNION SELECT NULL, NULL, table_name, table_name, NULL, table_name,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL FROM information_schema.tables WHERE table_type = \'base table\' -- \'','Processing...','angel.marecos@fiuni.edu.py');
