big_ed1eb5.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(21,7,'\r\nBrother CS6000i Feature-Rich Sewing Machine With 60 Built-In Stitches, 7 styles of 1-Step Auto-Size Buttonholes, Quilting Table, and Hard Cover\r\n','\r\nVersatile, value-packed, perfect for a wide range of sewing and quilting projects\r\nSelect stitches and adjust stitch length and stitch width via settings seen on the LCD display\r\nStop/start button allows use without included foot control. Variable speed control for easily adjusting your sewing speed\r\nJam-resistant Quick-set top drop-in bobbin makes setting and accessing your bobbin thread a breeze. No more fishing for your bobbin thread.\r\nBilingual user manual, 25-year limited warranty, and free phone support for the life of the product. We do not recommend using this machine in countries that do not support 120V AC even if a voltage adapter is in use\r\n',0,145,'Brother_CS6000i_Feature_Rich_Sewing_Machine_With_60_Built_In_Sti_small_d27419.jpg',NULL,NULL,0,0,'Brother_CS6000i_Feature_Rich_Sewing_Machine_With_60_Built_In_Sti_big_b18a95.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(22,7,'\r\nButton It - Medium Green Polka Dot Sewing Box with Floral Lining\r\n','\r\nUnique Features include a Button Popper Fastening and a Pin Cushion under the Lid. Also has a Lift Out Tray with Storage Space underneath\r\nGreen Polka Dot Exterior with a Floral Interior Lining and Red Detailing\r\nFantastic Gift\r\nSize: 9.4 x 4.9 x 6.7 inches\r\nLC Designs Supply many Department Stores throughout the World - Quality in a Brand you can Trust\r\n',0,50,'Button_It_Medium_Green_Polka_Dot_Sewing_Box_with_Floral_Lining_small_b55f26.jpg',NULL,NULL,0,0,'Button_It_Medium_Green_Polka_Dot_Sewing_Box_with_Floral_Lining_big_ffc52c.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(23,7,'\r\nDritz Tomato Pin Cushion\r\n','\r\nA pin cushion provides a safe place to store pins. This bright tomato keeps your pins and needles safe and within reach the strawberry emery will help to keep them sharp and free of burrs that could snag your fabrics.\r\n',0,1.2,'Dritz_Tomato_Pin_Cushion_small_06466e.jpg',NULL,NULL,0,0,'Dritz_Tomato_Pin_Cushion_big_7d0278.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(24,7,'\r\nFiskars 94167097J Kids Classic Blunt Tip Scissors, 5-Inch, Assorted Colors\r\n','\r\n	\r\nChildren love Fiskars Kids Scissors for the handle that\'s shiny, bright and smooth, not \"stickey\" or \"bumpy\". Teachers and moms love the safe design and the antimicrobial handle protection. All Fiskars Kids Scissors feature an innovative safety-edge blade for high-quality cutting with a safer blade angle, plus a larger finger loop and an ergonomic thumb loop to provide a natural, more comfortable fit for kids\' fingers. Ideal for ages four and up, our Kids Scissors are available with a variety of special features. Fiskars scissors have a lifetime warranty.\r\n',0,2,'Fiskars_94167097J_Kids_Classic_Blunt_Tip_Scissors_5_Inch_Assorte_small_e2f7fb.jpg',NULL,NULL,0,0,'Fiskars_94167097J_Kids_Classic_Blunt_Tip_Scissors_5_Inch_Assorte_big_9992ff.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(25,7,'\r\nHobby Gift Holiday Design Square Sewing Basket Pink & Blue on Cream Extra Large (30.5 x 30.5 x 22cm)\r\n','\r\nBrighten up any workroom with this \'Vintage Garden\' inspired Sewing Box. Contains colour coordinated plastic inner tray to help organise your smaller sewing accessories. EXTRA LARGE - Depth 30.5cm x Width 30.5cm x Height 22cm. Sturdy wooden handles . Large external pocket with, spacious internal compartment, lining 100% polyester and zip fastening at the top of the bag . Slightly padded/quilting decorative effect, outer material is premium 100% cotton\r\n',0,172,'Hobby_Gift_Holiday_Design_Square_Sewing_Basket_Pink_Blue_on_Crea_small_49a3ae.jpg',NULL,NULL,0,0,'Hobby_Gift_Holiday_Design_Square_Sewing_Basket_Pink_Blue_on_Crea_big_8f5b75.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(26,9,'\r\nAmazonBasics 2-Port USB Car Charger with 2.1 Amp Total Output (Black)\r\n','\r\nPlug and power\r\n\r\nJust plug the AmazonBasics 2-port USB car charger into your vehicle‚Äôs cigarette lighter socket and connect up to two USB devices at once. The AmazonBasics car charger is not compatible with the Nexus 7 tablet.\r\n\r\nIntelligent charging\r\n\r\nIntelligent IC chip monitors charging to direct the power to the device that needs it most. The charger will provide 2.1 amps maximum total output. With maximum output of 2.1 amps, two devices plugged simultaneously receive approximately 1.0 amps each.\r\n\r\nConvenience on the go\r\n\r\nCompact charger can travel with you daily to be ready whenever you need to power your devices.\r\n\r\nLED charging indicator\r\n\r\nLED lights when connected.\r\n\r\nAmazon Frustration-Free Packaging\r\n\r\nThis AmazonBasics product features Amazon Frustration-Free Packaging that is recyclable. It comes without excess packaging materials such as hard plastic clamshell casings, plastic bindings, or wire ties. The packaging is designed to be opened without the use of a box cutter or knife, and it will protect your product just as well as traditional packaging. Products with Amazon Frustration-Free Packaging can frequently be shipped in their own boxes, without an additional shipping box, saving on resources and reducing waste.\r\n',0,8.99,'AmazonBasics_2_Port_USB_Car_Charger_with_2_1_Amp_Total_Output_Bl_small_a7b4a8.jpg',NULL,NULL,0,0,'AmazonBasics_2_Port_USB_Car_Charger_with_2_1_Amp_Total_Output_Bl_big_d5b35b.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(27,9,'\r\nCarMD 2100 Vehicle Health System and Diagnostic Code Reader for OBDII Vehicles\r\n','\r\nComplete Solutions for Check Engine Lights\r\nThe CarMD database saves you the hassle of looking up codes and basing repair decisions on questionable sources. Our solutions come straight from working mechanics specializing in your vehicle and double checked by Master Technicians. It\'s like having thousands mechanics look at your vehicle and agreeing how it should be fixed.\r\n',0,80.59,'CarMD_2100_Vehicle_Health_System_and_Diagnostic_Code_Reader_for__small_ea408d.jpg',NULL,NULL,0,0,'CarMD_2100_Vehicle_Health_System_and_Diagnostic_Code_Reader_for__big_6eb077.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(28,9,'\r\nDuracell DRPP300 Powerpack 300-Watt Jump Starter and Emergency Power Source\r\n','\r\nDuracell is the brand that\'s \"trusted everywhere\" in households around the world for high-quality, long-lasting batteries and chargers. Following its tradition of superior quality and dependability, Duracell brings you highly reliable, rugged portable power solutions that can be counted on in any situation. From power outages and roadside emergencies to recreation and the great outdoors, you can count on the rugged, yet compact Duracell Powerpack 300 to give you the power you need. If an outlet is not in reach or plugging into the dashboard\'s cigarette lighter is simply not an option, the Duracell Powerpack 300 is the perfect solution. It comes with a multitude of safety and emergency features, and is powerful enough to start your car and robust enough to provide portable power for small appliances - it even comes with a 250 PSI air compressor to inflate your vehicle\'s tires, small sports equipment and toys. The heart of the Duracell Powerpack 300 is a sealed, non-spillable 12 ampere-hour AGM battery. The Powerpack can be safely and conveniently recharged from any household AC outlet or DC cigarette-lighter outlet, making it ready to go whenever you need it. This robust battery is tied to a power inverter that provides 300 watts of power to its two grounded AC outlets and one DC socket. Multiple outlets give you the flexibility and convenience to operate several appliances at once, while the battery level indicat