h breast milk production*\r\nTaste - Sweet, spicy, slightly bitter with a distinct licorice-like taste\r\nReason to Love\r\nWhile your bundle of joy is probably causing you no end of delight, moms can also feel overwhelmed and tired, especially when it comes to breastfeeding. We love the fact that this herbal tea has traditionally been used to help mothers support their production of breast milk and to promote healthy lactation.* With herbs like fennel, anise (which give the tea a sweet, licorice-like taste), coriander and fenugreek, each sip is like stepping into a tradition that has been passed down from woman to woman for hundreds of years.\r\nWe\'ve Got the Right Stuff\r\nThe herbs in this tea‚Äîfennel, anise, coriander, fenugreek, and blessed thistle‚Äîare galactagogues, which has nothing at all to do with their reputation for space travel and everything to do with their power to promote healthy lactation.* The term galactagogue comes from the Greek word ‚Äúgalactos,‚Äù meaning ‚Äúmilk‚Äù and ‚Äúagogue,‚Äù which means ‚Äúbringer of.‚Äù Women have been successfully using these herbs for centuries to help them breastfeed.\r\n',0,21.54,'Traditional_Medicinals_Organic_Mother_s_Milk_small_307e63.jpg',NULL,NULL,0,0,'Traditional_Medicinals_Organic_Mother_s_Milk_big_03515a.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(83,19,'\r\nVita Coco Coconut Water, 11.1 Ounce (Pack of 12)\r\n','\r\nAbout the Brand\r\nThe Vita Coco brand launched in 2004 and was initially sold only in health food stores. By 2006, the brand broke through into mainstream groceries and was selling in over 3,000 retail doors nationwide. Today, Vita Coco is now sold in over 5,000 retail doors nationwide.\r\nProduct Description\r\nNot so long ago, you had to use a machete if you wanted a sip of pure coconut water. We‚Äôve taken the machete out of the equation, which is good, because those things are dangerous. Now all that‚Äôs left is Mother Nature‚Äôs most hydrating, refreshing, vitamin- and mineral-rich nectar. Vita Coco is never made from concentrate. That means we pick, crack, and pack fresh young coconuts directly at the source. After the coconuts are cleaned, the delicate water inside is flash pasteurized (and occasionally mixed with all-natural fruit puree) then poured into a shelf-stable Tetra Pak. The entire process from tree to Pak doesn\'t exceed 72 hours. We hear the end result is a lot like sticking a straw in a coconut.\r\n',0,15.5,'Vita_Coco_Coconut_Water_small_a00750.jpg',NULL,NULL,0,0,'Vita_Coco_Coconut_Water_big_5ffe53.jpg',0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,NULL),(84,19,'\r\nViva Labs #1 Organic Extra Virgin Coconut Oil\r\n','\r\nThe #1 Coconut Oil for Freshness and Purity\r\n\r\nEvery coconut that goes into Viva Labs Coconut Oil is hand-picked at its peak for optimal freshness and nutritional value. USDA certified organic, non-GMO project verified, non-hexane and free of bleach or deodorizers, our coconut oil is the pure choice to suit your natural lifestyle. Can be used as a dietary supplement, for cooking, baking and as part of your natural beauty routine.\r\n\r\nUses of Viva Labs Coconut Oil:\r\n\r\nDietary Supplementation: Take 1-4 tablespoons per day for best results.\r\n\r\nCooking: Excellent for cooking up to 350¬∞F. Can be used as a dairy-free alternative to butter in baking and all of your favorite foods.\r\n\r\nSkin Care: Can be used as a luxurious body moisturizer. Especially helpful for dry, rough elbows and heels.\r\n\r\nHair Care: Makes an all-natural, restorative hair mask, adding hydration, gloss and manageability.\r\n\r\nHealth Benefits of Viva Labs Coconut Oil:\r\n\r\nRich in Medium-Chain Triglycerides (MCTs): Rich in Medium-Chain Triglycerides (MCTs): MCTs are a unique form of fatty acids that are used by the body as a source of energy and have been shown to be beneficial in helping to maintain a healthy weight, increase stamina and promote healthy metabolism of nutrients.\r