 deadly, light armored Samurai and Assassins with a healer to protect, buff, and revive them when they do get hit? Its all up to you!\n\nYou can pick race, gender, and class for your party members, and even get to choose from a limited set of voice sounds as well as the character portrait. Be advised, the portraits (and in fact much of the game play) follows the standard JRPG format of scantily clad ladies and slightly risque situations (in addition to standard armor, you can equip/upgrade the characters \"undies\"). I think its totally harmless (and no where near as nauseatingly over-sexualized as games like Dragons Crown), but some may be put off.\n\nThe artwork of the stills is quite nice, and its a shame the battle sequences aren	 fully animated...its decidedly old school and reminds me a bit of games like Phantasy Star. Still, being able to build your party as youd like, equip them with multiple weapons sets that can be switched in combat (to allow melee/ranged attacks if youd like), and the twists with game play such as unlocking the \"demon\" mechanic or equipping artifacts that bestow the abilities of other classes, add enough complexity and strategic sophistication to really make the game engrossing.\n\nThis game is by no means perfect, and doesn	 really break much new ground, but is well put together with fun and challenging game play. While save points are frequent enough to allow pick up/put down gaming (ideal on the Vita), Ive found myself happily sinking a few hours at a time tweaking my characters, selling/stockpiling items, and exploring the many challenging dungeons.','2014-07-28 02:57:50',0,4),(344,25,'CTChuck','eml343_ctchuck@example.com','These are great, but its sometimes difficult to install correctly; so I always ask the store to install it.','2014-07-28 02:57:40',0,5),(345,10,'Tommy2009','eml344_tommy2009@example.com','David Gray is a highly under rated artist. His albums are filled with great lyrics and catchy arrangements. This album is no 